def adjust_path(
        metadata: Dict,
        old_customer: str,
        new_customer: str,
        bucket: str,
        file_schema: str,
        key_prefix: str,
):
    path = metadata.get("path", {})
    if path:
        # override path.file_schema if file_schema is given
        if file_schema and path.get("file_schema"):
            path["file_schema"] = file_schema
        # override path.bucket if bucket is given
        if bucket and path.get("bucket"):
            path["bucket"] = bucket
        else:
            # change bucket name, replace old_customer with new_customer
            if new_customer != old_customer and path.get("bucket"):
                path["bucket"] = path["bucket"].replace(
                    old_customer,
                    new_customer,
                )
        # add key prefix
        if key_prefix and path.get("key"):
            path["key"] = key_prefix + path["key"]
